import React from 'react';
import { HardHat, Utensils, Construction, Truck, Building, Heart, ShoppingBag } from 'lucide-react';
// FIX: Using standard relative path
import useScrollAnimation from '../hooks/useScrollAnimation.js';

const serviceData = [
    { 
        title: "Oil & Gas", 
        description: "Experienced engineers, technicians, and field workers trained in international safety standards for oil rigs, refineries, and petrochemical plants.", 
        icon: HardHat 
    },
    { 
        title: "Hospitality", 
        description: "Professional staff including receptionists, housekeeping, kitchen assistants, waiters, and service crew ensuring seamless guest satisfaction.", 
        icon: Utensils 
    },
    { 
        title: "Construction & Skilled Workers", 
        description: "Deploying skilled and unskilled workers: Masons, Carpenters, Electricians, Plumbers, HVAC technicians, Welders, and general helpers.", 
        icon: Construction 
    },
    { 
        title: "Logistics & Warehousing", 
        description: "Manpower for forklift operators, loaders & pickers, packing staff, and inventory management.", 
        icon: Truck 
    },
    { 
        title: "Facility Management", 
        description: "Support for day-to-day building operations including cleaners, landscaping teams, and maintenance technicians.", 
        icon: Building 
    },
    { 
        title: "Healthcare", 
        description: "Manpower to support hospitals and clinics: Nursing assistants, patient care staff, and administrative support.", 
        icon: Heart 
    },
    { 
        title: "Retail & Customer Service", 
        description: "Supporting retail chains with Sales associates, Cashiers, Store helpers, and Customer support staff.", 
        icon: ShoppingBag 
    },
    // Missing Events & Entertainment from the list, adding a placeholder for completeness
    { 
        title: "Events & Entertainment", 
        description: "Temporary and long-term staff for ushers, stage crew, catering, and security for various events.", 
        icon: HardHat 
    },
];

const ServiceCard = ({ title, description, Icon }) => {
    const [ref, isVisible] = useScrollAnimation(0.1);
    
    return (
        <div 
            ref={ref}
            className={`p-6 bg-white rounded-xl shadow-lg border-t-4 border-arm-gold transition duration-1000 ${isVisible ? 'opacity-100 translate-y-0' : 'opacity-0 translate-y-10'}`}
        >
            <Icon className="h-12 w-12 text-arm-blue mb-4 bg-arm-gold/20 p-2 rounded-full" />
            <h3 className="text-xl font-bold text-arm-blue mb-2">{title}</h3>
            <p className="text-gray-600 text-sm">{description}</p>
        </div>
    );
};

const DirectorsSection = () => {
    const directors = [
        { name: "Mr. Mohammed Rizwan Ahmed", role: "Head of Operations Manager", experience: "14+ years in manpower solutions. Focus on large-scale operations and workforce management." },
        { name: "Mr. Mujeeb Ullah", role: "Sales Manager", experience: "10+ years in client relationship management and strategic sales in the manpower sector." },
        { name: "Mr. Mohammad Hamid Ansari", role: "Recruitment Manager", experience: "10+ years in talent acquisition, workforce planning, and strategic hiring practices." },
        { name: "Mr. Mohammed Tajammul Ahmed", role: "Training & Development Specialist", experience: "Extensive expertise in grooming soft services personnel for housekeeping, hospitality, and facility management." },
    ];

    return (
        <div id="directors" className="mt-20">
            <h2 className="heading-secondary text-center mb-10">Our Leadership Team</h2>
            <div className="grid md:grid-cols-2 lg:grid-cols-4 gap-8">
                {directors.map((director, index) => {
                     const [ref, isVisible] = useScrollAnimation(0.1);
                    return (
                        <div 
                            key={index} 
                            ref={ref}
                            className={`p-6 bg-arm-blue/90 text-white rounded-xl shadow-xl transition duration-1000 delay-${index*100} ${isVisible ? 'opacity-100 translate-y-0' : 'opacity-0 translate-y-10'}`}
                        >
                            <h3 className="text-xl font-bold mb-1 text-arm-gold">{director.name}</h3>
                            <p className="text-sm font-semibold mb-3">{director.role}</p>
                            <p className="text-xs text-gray-300 italic">{director.experience}</p>
                        </div>
                    );
                })}
            </div>
        </div>
    );
};


const Services = () => {
    return (
        <section id="services" className="section-container bg-gray-100">
            <h2 className="heading-primary text-center mb-16">
                Industries We Serve
            </h2>
            
            <div className="grid sm:grid-cols-2 lg:grid-cols-3 xl:grid-cols-4 gap-8">
                {serviceData.map((service, index) => (
                    <ServiceCard key={index} {...service} />
                ))}
            </div>

            <DirectorsSection />
        </section>
    );
};

export default Services;
